import React from 'react';

class Table extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      students: [
        {
          id: 101,
          firstname: 'Wade',
          lastname: 'Wilson',
        },
        {
          id: 102,
          firstname: 'Steve',
          lastname: 'Rogers',
        },
        {
          id: 103,
          firstname: 'Bucky',
          lastname: 'Barnes'
        }
      ]
    };
  }

  renderTableData() {
    return this.state.students.map((student, i) => {
      const { id, firstname, lastname } = student;

      return (
        <tr key={id}>
          <td>{firstname}</td>
          <td>{lastname}</td>
        </tr>
      );
    });
  }

  render () {
    return (
      <div>
        <h1>Gradebook Sample App</h1>
        <table id='students'>
          <tbody>
            {this.renderTableData()}
          </tbody>
        </table>
      </div>
    )
  }

}

export default Table;
